
<!DOCTYPE html>
<html>
  <head>
    <meta charset="UTF-8">
    <title>Swagger UI</title>
    <link rel='icon' type='image/png' href='https://api.markitdigital.com/api-ui/v1/images/favicon-32x32.png' sizes='32x32'>
    <link rel='icon' type='image/png' href='https://api.markitdigital.com/api-ui/v1/images/favicon-16x16.png' sizes='16x16'>
    <link href='https://api.markitdigital.com/api-ui/v1/css/typography.css' media='screen' rel='stylesheet' type='text/css'>
    <link href='https://api.markitdigital.com/api-ui/v1/css/reset.css' media='screen' rel='stylesheet' type='text/css'>
    <link href='https://api.markitdigital.com/api-ui/v1/css/screen.css' media='screen' rel='stylesheet' type='text/css'>
    <link href='https://api.markitdigital.com/api-ui/v1/css/reset.css' media='print' rel='stylesheet' type='text/css'>
    <link href='https://api.markitdigital.com/api-ui/v1/css/print.css' media='print' rel='stylesheet' type='text/css'>
  </head>
  <body class="swagger-section">
  <div id='header'>
    <div class="swagger-ui-wrap">
      <a id="logo" href="http://swagger.io">markit digital | swagger</a>
      <form id='api_selector' style="display:none">
        <div class='input'><input placeholder="http://example.com/api" id="input_baseUrl" name="baseUrl" type="text"/></div>
        <div class='input'><input placeholder="api_key" id="input_apiKey" name="apiKey" type="text"/></div>
        <div class='input'><a id="explore" href="#" data-sw-translate>Explore</a></div>
      </form>
    </div>
  </div>
  <div id="message-bar" class="swagger-ui-wrap" data-sw-translate>&nbsp;</div>
  <div id="swagger-ui-container" class="swagger-ui-wrap"></div>
  <script type='text/javascript' src='https://api.markitdigital.com/api-ui/v1/js/jquery-1.8.0.min.js'></script>
  <script type='text/javascript' src='https://api.markitdigital.com/api-ui/v1/js/jquery.slideto.min.js'></script>
  <script type='text/javascript' src='https://api.markitdigital.com/api-ui/v1/js/jquery.wiggle.min.js'></script>
  <script type='text/javascript' src='https://api.markitdigital.com/api-ui/v1/js/jquery.ba-bbq.min.js'></script>
  <script type='text/javascript' src='https://api.markitdigital.com/api-ui/v1/js/handlebars-2.0.0.js'></script>
  <script type='text/javascript' src='https://api.markitdigital.com/api-ui/v1/js/underscore-min.js'></script>
  <script type='text/javascript' src='https://api.markitdigital.com/api-ui/v1/js/backbone-min.js'></script>
  <script type='text/javascript' src='https://api.markitdigital.com/api-ui/v1/js/swagger-ui.js'></script>
  <script type='text/javascript' src='https://api.markitdigital.com/api-ui/v1/js/highlight.7.3.pack.js'></script>
  <script type='text/javascript' src='https://api.markitdigital.com/api-ui/v1/js/jsoneditor.min.js'></script>
  <script type='text/javascript' src='https://api.markitdigital.com/api-ui/v1/js/marked.js'></script>
  <script type='text/javascript' src='https://api.markitdigital.com/api-ui/v1/js/swagger-oauth.js'></script>
  <script type='text/javascript' src='https://api.markitdigital.com/api-ui/v1/js/index.js'></script>
  </body>
</html>
